function findString(s) {
    s = s || "Blitz"
    if (this.lastSearchString != s) {
       this.hideSearchActivity();
    }
    try {
    var regExp = new RegExp(s, "gm")
    } catch (e) {
        return 
    }
    if (this.lastSearchIndex)
        regExp.lastIndex = this.lastSearchIndex + 1;
    var m = regExp.exec(this.textString)
    if (m === null) {
        this.hideSearchActivity();
        return
    }
    if (this.searchHighlights) {
        this.searchHighlights.invoke('remove')
        this.searchHighlights = []
    };
    this.lastSearchIndex = m.index
    var localBounds = this.highlightFromTo(m.index, m.index + m[0].length)
    if (m[1]) {
        var index = this.textString.indexOf(m[1], this.lastSearchIndex)
        this.highlightFromTo(index, index + m[1].length )
    }



    this.setSelectionRange(m.index, m.index + m[0].length)

    this.scrollToBottom()
    this.scrollRectIntoView(localBounds)
}

