function highlightFromTo(from, to) {
    // hack: do two selections, because multiple is broken
    this.setSelectionRange(from, from + 1)
    var b1 = this.getSelectionBounds()
    this.setSelectionRange(to - 1, to)
    var b2 = this.getSelectionBounds()

    // don't show 
    this.setSelectionRange(from, to)

    var localBounds = rect(this.localize(b1.topLeft()), this.localize(b2.bottomRight()))
    var rects;
    if (b1.top() == b2.top()) {
        rects = [localBounds]
    } else {
        var lineHeight = this.getFontSize() + 5; // guess
        rects = [rect(localBounds.topLeft(),
                    pt(this.getExtent().x, localBounds.topLeft().y + lineHeight)),
                 rect(pt(0,localBounds.topLeft().y + lineHeight),
                    pt(this.getExtent().x, localBounds.bottomRight().y - lineHeight)),
                rect(pt(0,localBounds.bottomRight().y-lineHeight),
                    localBounds.bottomRight())]
    }

    rects.each(function(ea) {
            var highligthMorph =  new lively.morphic.Box(ea);
            highligthMorph.setFill(Color.blue)
            highligthMorph.setOpacity(0.3)
            highligthMorph.isEpiMorph = true;
            highligthMorph.disableEvents();
            this.searchHighlights.push(highligthMorph);
            this.addMorph(highligthMorph)
    }, this)
    return localBounds
}

